Ext.data.JsonP.Ext_fx_Easing({"allMixins":[],"tagname":"class","deprecated":null,"singleton":true,"author":null,"alias":null,"superclasses":[],"mixins":[],"html":"<div><div class='doc-contents'><p>This class contains a series of function definitions used to modify values during an animation.\nThey describe how the intermediate values used during a transition will be calculated. It allows for a transition to change\nspeed over its duration. The following options are available:</p>\n\n<ul>\n<li>linear The default easing type</li>\n<li>backIn</li>\n<li>backOut</li>\n<li>bounceIn</li>\n<li>bounceOut</li>\n<li>ease</li>\n<li>easeIn</li>\n<li>easeOut</li>\n<li>easeInOut</li>\n<li>elasticIn</li>\n<li>elasticOut</li>\n<li>cubic-bezier(x1, y1, x2, y2)</li>\n</ul>\n\n\n<p>Note that cubic-bezier will create a custom easing curve following the CSS3 <a href=\"http://www.w3.org/TR/css3-transitions/#transition-timing-function_tag\">transition-timing-function</a>\nspecification.  The four values specify points P1 and P2 of the curve as (x1, y1, x2, y2). All values must\nbe in the range [0, 1] or the definition is invalid.</p>\n</div><div class='members'></div></div>","subclasses":[],"code_type":"assignment","linenr":1,"html_filename":"Easing.html","alternateClassNames":[],"protected":false,"requires":[],"docauthor":null,"static":false,"members":{"event":[],"property":[],"method":[],"css_var":[],"css_mixin":[],"cfg":[]},"component":false,"xtypes":[],"inheritable":false,"private":false,"extends":null,"name":"Ext.fx.Easing","statics":{"event":[],"property":[],"method":[],"css_var":[],"cfg":[],"css_mixin":[]},"mixedInto":[],"href":"Easing.html#Ext-fx-Easing","uses":[],"filename":"/Users/nickpoulden/Projects/sencha/SDK/platform/src/fx/Easing.js"});